<?php
include 'header.php';
$_SESSION['page'] = 'map';
$username = $_SESSION['username'];

$sqlTeam = "SELECT * FROM team WHERE username = ?";
$stmtTeam = $pdo->prepare($sqlTeam);
$stmtTeam->execute([$_SESSION['username']]);
$rowTeam = $stmtTeam->fetch();

$getCityNamesql = "SELECT * FROM city WHERE id = ?";
$getCityNamestmt = $pdo->prepare($getCityNamesql);
$getCityNamestmt->execute([$rowTeam['location_now_id_city']]);
$getCityNamerow = $getCityNamestmt->fetch();

$timestamp = date("d-m-Y H:i:s");

//CEK BONUS BALI TOURISM PARADISE
$bonusBalisql = "SELECT * FROM `team_constructed_landmark` WHERE id_landmark = 3 AND id_team = ? ORDER BY id LIMIT 20";
$bonusBalistmt = $pdo->prepare($bonusBalisql);
$bonusBalistmt->execute([$rowTeam['id']]);
if ($bonusBalistmt->rowCount() != 0) {
    $cooldown = strtotime($rowTeam['cooldown']);
    $disableCooldown = $cooldown + (60 * 14);
    $disableCooldown = strtotime(date("d-m-Y H:i:s", $disableCooldown));
} else {
    $cooldown = strtotime($rowTeam['cooldown']);
    $disableCooldown = $cooldown + (60 * 19);
    $disableCooldown = strtotime(date("d-m-Y H:i:s", $disableCooldown));
}

